import React, { Component } from 'react'
import { connect } from 'react-redux'
import { Video } from 'grommet'

export const Vid = () => {
    return (
        <Video controls="over" fit="cover">
            <source key="video" src="./../../public/kaaris.mp4" type="video/mp4" />
        </Video>
    )
}



export default Vid
